import {QuestionActionTypes} from './question.types';

export const setFetchedQuestionsToState=questions=>({
    type:QuestionActionTypes.SET_FETCHED_QUESTIONS_TO_STATE_C2C,
    payload:questions
})

export const setSelectedQuestion=num=>({
    type:QuestionActionTypes.SET_SELECTED_QUESTION_C2C,
    payload:num-1
})

export const setSelectedAnswer=num=>({
    type:QuestionActionTypes.SET_SELECTED_ANSWER_C2C,
    payload:num
})

export const selectedQuestionNext=num=>({
    type:QuestionActionTypes.SELECTED_QUESTION_NEXT_C2C,
    payload:num+1
})

export const selectedQuestionPrevious=num=>({
    type:QuestionActionTypes.SELECTED_QUESTION_PREVIOUS_C2C,
    payload:num-1
})

